import Posts from '../../containers/Posts/Posts'
import './Blog.css';

class Blog extends Component {



    render () {


        return (
            <div>
                <header className="Blog">
                    <nav>
                        <ul>
                            <li><a href="/">Home</a></li>
                            <li><a href="/new-post">New Post</a></li>
                        </ul>
                    </nav>
                </header>
                <Route path="/" exact render={() => <h1>Home</h1>}/>

            </div>
        );
    }
}

export default Blog;
